    data.foreach((d)=>{
      arrdata.push({
        "key" : d.key_as_string,
        "count" : d.group_by_Type.buckets.forEach((bucket)=>{
            counttype.push({'total':bucket.total_count.value,'type':bucket.key});
        })
      })
    })
  }
 generateData({fetcheddata});
